import React, { Component } from "react";
import "./Home.css";

export class Home extends Component {
  render() {
    return (
      <div>
        <p>Home</p>
        <div className="searchInputs">
          <input
            type="text"
            placeholder="What items you are looking for?"
          ></input>
          <i class="fas fa-search"></i>
        </div>
      </div>
    );
  }
}
export default Home;
